import Style from "./card.module.css"

const Card = (props) => {
    return(
        <div onClick class={Style.card}>
            <p>Number:{props.id}</p>
            <img class={Style.imagen} src={props.imagen} alt="imagen"></img>
            <p class={Style.name}>{props.nombre.charAt(0).toUpperCase() + props.nombre.substring(1)}</p>
            <br></br>
        </div>
    )
}

